            // Function to populate the table with data
            function populateTable() {
                const tableBody = document.getElementById('tablebody');

                data.forEach(row => {
                    const newRow = document.createElement('tr');

                    const reporterCell = document.createElement('td');
                    reporterCell.textContent = row.REPORTER;
                    newRow.appendChild(reporterCell);

                    const partnerCell = document.createElement('td');
                    partnerCell.textContent = row.PARTNER;
                    newRow.appendChild(partnerCell);

                    const valueCell = document.createElement('td');
                    valueCell.textContent = row['VALUE ($)'];
                    newRow.appendChild(valueCell);

                    tableBody.appendChild(newRow);
                });
            }

            // Call the populateTable function on page load
            window.addEventListener('DOMContentLoaded', populateTable);
